import React from "react";
import ForecastWeatherCard from "./ForecastWeatherCard";

const ForecastWeather = ({ data }) => {
  return (
    <div className="forecast-wrapper">
      {data.daily !== undefined && (
        <>
          <ForecastWeatherCard data={data.daily[1]} offSet={1} />sunny
          <ForecastWeatherCard data={data.daily[2]} offSet={2} />
          <ForecastWeatherCard data={data.daily[3]} offSet={3} />
          <ForecastWeatherCard data={data.daily[4]} offSet={4} />
          <ForecastWeatherCard data={data.daily[5]} offSet={5} />
          <ForecastWeatherCard data={data.daily[6]} offSet={6} />
          <ForecastWeatherCard data={data.daily[7]} offSet={7} />
        </>
      )}
    </div>
  );
};

export default ForecastWeather;
